        return (
            <nav className="Navbar">
                <Link to="/">Home Page</Link>
                <br />

                {!this.props.user
                    ? (
                        <div>
                            <Link to="/signup">Sign Up</Link>
                            <br />
                            <Link to="/login">Log In</Link>
                        </div>
                    ) : (
                        <div>
                            <Link to="/profile">Profile</Link>
                            <br />
                            <button onClick={()=>this.props.logOut()}>Log Out</button>
                        </div>
                    )
                }
            </nav>
	    );
    }

}

export default Navbar;
